import React, { Component } from 'react';

export class Home extends Component {
  static displayName = Home.name;

  render() {
    return (
      <div>
        <h1>Guncel Konular Projesi</h1>
        <ul>
          <li>Süleyman Abbud</li>
          <li>Ahmet Hakan Tulgac</li>
          <li>Okkescan Kucukonder</li>
          <li>Elif Feyza Altın</li>
          <li>Gamze Nur Karali</li>
        </ul>
       
      </div>
    );
  }
}
